import { Box, Button, Heading } from "@chakra-ui/react";
import NavBar from "../components/NavBar";

const LandingPage = () => {
    return(
        <>
        <NavBar/>
        <Box height="100vh" position="relative" bgColor="#F5F7FA" bgSize="cover">
            <Heading size='4xl' paddingTop='50' as='h1' textColor="#4D4D4D"> Solo Mina Fish </Heading>
            <Heading size='2xl' as='h3' textColor='#4CAF4F'> Since 20 Years</Heading>
            <Heading as='h3'>Fish Consumption Supplier</Heading>
            <Button bgColor='#4CAF4F' textColor='white'>Contact</Button>
        </Box>
        </>
    )
};

export default LandingPage;
